03cspan style=\"color:#808080;\"\u003e\u003c/span\u003eOm morgenen den 17. februar hadde vinden l\u00f8yet, og fiskerne\u003cbr\u003ebestemte seg for \u00e5 g\u00e5 ut p\u00e5 feltet og snu garnene, selv om\u003cbr\u003evaermeldingen varslet nordlig full storm fra kvelden. \u00abUtvik Senior\u00bb\u003cbr\u003eforlot Steinfjord p\u00e5\u003cb\u003e formiddage\u003c/b\u003en\u003cspan style=\"color:#808080;\"\u003e.\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1970\u003cbr\u003egrouping: 1970-2015\u003cbr\u003eidentifier: 1970-2015_formiddagen_24\u003cbr\u003etype: usage\u003c/p\u003e", "x": 720.1349196517267, "y": -222.89193039736745}, {"color": "#377eb8", "id": "1970-2015_formiddagen_43", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eHan kom tilbake til Trondheim med en hestetransport til Leangen\u003cbr\u003eom \u003cb\u003eformiddagen\u003c/b\u003e.\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1970\u003cbr\u003egrouping: 1970-2015\u003cbr\u003eidentifier: 1970-2015_formiddagen_43\u003cbr\u003etype: usage\u003c/p\u003e", "x": -166.0098608993335, "y": -734.6830725180166}, {"color": "#377eb8", "id": "1929-1965_formiddagen_71", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eDet var ved bordet om \u003cb\u003eformiddagen\u003c/b\u003e hu hadde sett at det\u003cbr\u003evar noe omframt med \u0027n Konrad.\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1929\u003cbr\u003egrouping: 1929-1965\u003cbr\u003eidentifier: 1929-1965_formiddagen_71\u003cbr\u003etype: usage\u003c/p\u003e", "x": 313.2849419815932, "y": -524.3786134747975}, {"color": "#377eb8", "id": "1970-2015_formiddagen_39", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eI l\u00f8pet av \u003cb\u003eformiddagen\u003c/b\u003e hadde Norsk Folkehjelp gjennom en\u003cbr\u003eenkelt telefon til HUMseksjonen f\u00e5tt autorisasjon til \u00e5 benytte\u003cbr\u003eeksisterende bevilgning til katastrofehjelp.\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1970\u003cbr\u003egrouping: 1970-2015\u003cbr\u003eidentifier: 1970-2015_formiddagen_39\u003cbr\u003etype: usage\u003c/p\u003e", "x": 85.72467674095651, "y": -651.7424788359182}, {"color": "#377eb8", "id": "1970-2015_formiddagen_56", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eFlere mennesker ute p\u00e5 gaten denne \u003cb\u003eformiddagen\u003c/b\u003e enn p\u00e5\u003cbr\u003eselveste Independence Day uken eller to f\u00f8r. Skuelystne.\u003cbr\u003eNysgjerrige.\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1970\u003cbr\u003egrouping: 1970-2015\u003cbr\u003eidentifier: 1970-2015_formiddagen_56\u003cbr\u003etype: usage\u003c/p\u003e", "x": -195.73457828711787, "y": 121.87406925555946}, {"color": "#377eb8", "id": "1970-2015_formiddagen_70", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eOm \u003cb\u003eformiddagen\u003c/b\u003e var det klart at forholdene var kritiske,\u003cbr\u003eog militaere mannskaper ble satt inn. Om kvelden gikk str\u00f8mmen stri\u003cbr\u003eved g\u00e5rden og gjennom gardstunet\u003cspan style=\"color:#808080;\"\u003e.\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1970\u003cbr\u003egrouping: 1970-2015\u003cbr\u003eidentifier: 1970-2015_formiddagen_70\u003cbr\u003etype: usage\u003c/p\u003e", "x": -423.65763959796686, "y": 580.5243216858403}, {"color": "#377eb8", "id": "1929-1965_formiddagen_0", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eDet var naivm\u00f8rkt i stuen, skj\u00f8nt det var langt ut p\u00e5\u003cbr\u003e\u003cb\u003eformiddagen\u003c/b\u003e. Utenfor stod novemberskodden tykk og gr\u00e5 og\u003cbr\u003e\u00fcbevegelig, og ovnen vilde ikke trekke.\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1929\u003cbr\u003egrouping: 1929-1965\u003cbr\u003eidentifier: 1929-1965_formiddagen_0\u003cbr\u003etype: usage\u003c/p\u003e", "x": -403.12684832100683, "y": -264.95715310013526}, {"color": "#377eb8", "id": "1970-2015_formiddagen_31", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eI mellomtiden fortsatte Fremad med artilleriavdelingen ombord\u003cbr\u003etil Trones og kom frem klokken 10.40 om \u003cb\u003eformiddagen\u003c/b\u003e.\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1970\u003cbr\u003egrouping: 1970-2015\u003cbr\u003eidentifier: 1970-2015_formiddagen_31\u003cbr\u003etype: usage\u003c/p\u003e", "x": 456.8314808566475, "y": 473.51692673473906}, {"color": "#377eb8", "id": "1929-1965_formiddagen_81", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eUt p\u00e5 \u003cb\u003eformiddagen\u003c/b\u003e var det ikke mere fremkomst, og vi\u003cbr\u003egjorde fast til en stor grunn-is. Dette koss var temmelig h\u00f8yt, mer\u003cbr\u003eenn 20 fot, omtrent jevnh\u00f8yt med baugen p\u00e5 \u00abCorrect\u00bb, og det hadde\u003cbr\u003emest loddrette sider, s\u00e5 ved \u00e5 legge en leider over fra bakken kunne\u003cbr\u003evi krabbe like i land p\u00e5 kosset.\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1929\u003cbr\u003egrouping: 1929-1965\u003cbr\u003eidentifier: 1929-1965_formiddagen_81\u003cbr\u003etype: usage\u003c/p\u003e", "x": 750.0, "y": 189.21190488151598}, {"color": "#377eb8", "id": "1929-1965_formiddagen_187", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eOm \u003cb\u003eformiddagen\u003c/b\u003e fyltes stuen p\u00e5 Elvsaet av\u003cbr\u003enytt\u00e5rsvisitter . . \u003cspan style=\"color:#808080;\"\u003e.\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1929\u003cbr\u003egrouping: 1929-1965\u003cbr\u003eidentifier: 1929-1965_formiddagen_187\u003cbr\u003etype: usage\u003c/p\u003e", "x": -34.49338636641386, "y": -133.2308366016403}, {"color": "#377eb8", "id": "1929-1965_formiddagen_25", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eUt p\u00e5 \u003cb\u003eformiddagen\u003c/b\u003e viste han sig p\u00e5 g\u00e5rden hos fogdens.\u003cbr\u003eGiilcke var den eneste av embedsmennene fra hin tid, som ennu hang ved\u003cbr\u003eembedet, efterat ogs\u00e5 Rist hadde tatt avskjed.\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1929\u003cbr\u003egrouping: 1929-1965\u003cbr\u003eidentifier: 1929-1965_formiddagen_25\u003cbr\u003etype: usage\u003c/p\u003e", "x": -569.9235642142263, "y": -443.02133855643024}, {"color": "#377eb8", "id": "1970-2015_formiddagen_27", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eBr\u00f8set hver torsdag hvor ca. 2o personer deltar i puljer. TPS\u003cbr\u003eAvd. \u00d8stmarka har avtale med et treningsinstitutt i Trondheim hvor\u003cbr\u003epasientene kan komme \u00e5 ha trening om \u003cb\u003eformiddagen\u003c/b\u003e.\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1970\u003cbr\u003egrouping: 1970-2015\u003cbr\u003eidentifier: 1970-2015_formiddagen_27\u003cbr\u003etype: usage\u003c/p\u003e", "x": 416.94936774501195, "y": 118.84059958916778}, {"color": "#377eb8", "id": "1929-1965_formiddagen_98", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eResten av \u003cb\u003eformiddagen\u003c/b\u003e tilbringer de med \u00e5 rote omkring i\u003cbr\u003ealle de s\u00f8ppelhauger som finnes; de gnager og slikker p\u00e5 alle de tomme\u003cbr\u003eblikkboksene som de har unders\u00f8kt hundre ganger f\u00f8r. Kommer s\u00e5 en ny\u003cbr\u003een dansende ned p\u00e5 isen fra kokken, blir det straks slagsm\u00e5l om\u003cbr\u003eeiendomsretten.\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1929\u003cbr\u003egrouping: 1929-1965\u003cbr\u003eidentifier: 1929-1965_formiddagen_98\u003cbr\u003etype: usage\u003c/p\u003e", "x": 115.92917607379503, "y": 243.2343991527823}, {"color": "#377eb8", "id": "1970-2015_formiddagen_46", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eSeiv om ingen store vedtak med vidtrekkende betydning ble\u003cbr\u003efattet i denne perioden, hadde kommunestyret mange og lange m\u00f8ter som\u003cbr\u003ebegynte kl. 9 p\u00e5 \u003cb\u003eformiddagen\u003c/b\u003e.\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1970\u003cbr\u003egrouping: 1970-2015\u003cbr\u003eidentifier: 1970-2015_formiddagen_46\u003cbr\u003etype: usage\u003c/p\u003e", "x": 447.5897611082921, "y": -278.518055877815}, {"color": "#377eb8", "id": "1929-1965_formiddagen_161", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eHele \u003cb\u003eformiddagen\u003c/b\u003e l\u00e5 de der og stekte sig i den varme\u003cbr\u003ebl\u00f8te sanden bare avbrudt av en dukkert av og til n\u00e5r det blev altfor\u003cbr\u003evarmt. \u00abJa n\u00e5 er dere vel sultne tenker jeg,\u00bb sa fru Gram da det led\u003cbr\u003emot middag. \u00abJa, det skal vaere sikkert, jeg kunde gjerne spise\u003cbr\u003egr\u00e5sten,\u00bb sa Vesla. \u00ab\u00c5 n\u00e5, du vil kanskje heller ha det enn biff da,\u003cbr\u003efor det har jeg med mig.\u00bb \u00ab\u00c5 Brita, du er en knupp, biff som er det\u003cbr\u003ebeste vi vet,\u00bb kom det i kor. Brita smilte\u003cspan style=\"color:#808080;\"\u003e.\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1929\u003cbr\u003egrouping: 1929-1965\u003cbr\u003eidentifier: 1929-1965_formiddagen_161\u003cbr\u003etype: usage\u003c/p\u003e", "x": 52.450531630143615, "y": 675.8859324958025}, {"color": "#377eb8", "id": "1929-1965_formiddagen_185", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eMen over korset var skrevet: Jesus av Nasaret, j \u00f8de ne s\u003cbr\u003ekonge. Klokken var da 9 om \u003cb\u003eformiddagen\u003c/b\u003e. Jesus bad: Fader,\u003cbr\u003eforlat dem, for de vet ikke hvad de gj\u00f8r.\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1929\u003cbr\u003egrouping: 1929-1965\u003cbr\u003eidentifier: 1929-1965_formiddagen_185\u003cbr\u003etype: usage\u003c/p\u003e", "x": -741.18752810005, "y": 179.93166114575232}]);
